(function(S){
    if(typeof S.ClickableImgFn === "undefined") {
        OSM.Survey.ClickableImgFn = {
            "Ver": "20200320",  //remove not compatible in ie,  restore issue solved
            "TouchEvent": function(){
                var EF = RM.OSM.PlatformSpecifics.getAnswerSelectionEventFormat(),
                    R = "";
                switch(EF.toLowerCase()){
                    case 'ontouchend':
                        R='touchend'; break;
                    case 'onmousedown':
                    case 'onclick':
                        R='click'; break;
                    default:
                        R='click'; break;                       
                }
                return R;
            },
            "Collection": {},
            "DrawShape": function(C, A, St, F){             
                var CT = C.CT,
                    shape = C.AreaList[A].SType,
                    coords = C.AreaList[A].Coord,
                    RatioH = C.RatioH,
                    RatioW = C.RatioW,
                    StrokeV = C.Stroke.value,
                    FillV = C.Fill.value;
                CT.beginPath();
                if(shape == 'rect') {
                    // x, y, width, height
                    CT.rect(coords[0]*RatioW, coords[1]*RatioH, (coords[2] - coords[0])*RatioW, (coords[3] - coords[1])*RatioH);
                } else if(shape == 'poly') {
                CT.moveTo(coords[0]*RatioW, coords[1]*RatioH);
                    for(i=2; i < coords.length; i+=2) {
                        CT.lineTo(coords[i]*RatioW, coords[i+1]*RatioH);
                    }
                } else if(shape == 'circle' || shape == 'circ') {
                    // x, y, radius, startAngle, endAngle, anticlockwise
                    CT.arc(coords[0]*RatioW, coords[1]*RatioH, coords[2]*RatioH, 0, Math.PI * 2, false);
                }
                CT.closePath();
                if(St==1){
                    CT.strokeStyle = C.Stroke.style;
                    CT.strokeWidth = C.Stroke.width;
                    CT.stroke();
                }
                if(F==1 && FillV==1){
                    CT.fillStyle = C.Fill.style;
                    CT.fill();
                }
            },
            "Highlight": function(Q){
                var uID = Q.get('uniqueID'),
                    This = OSM.Survey.ClickableImgFn,
                    ThisC = This.Collection[uID],
                    Ready=true;
                if(ThisC==void 0){
                    Ready=false;
                } else {
                    if(ThisC.AreaList==void 0){
                        Ready=false;
                    }
                }
                if(Ready){
                    var AL = ThisC.AreaList,
                        AnsSet = ThisC.Q.get('answerSet'),
                        AnsList = ThisC.Q.getAnswers(),
                        AnsArr = AnsList.split(","),
                        AnsSelect = "",
                        SvT = 0;
                    ThisC.CT.clearRect(0,0,ThisC.C.width,ThisC.C.height);
                    Object.keys(AL).forEach(function(A){
                        if(!AnsSet[A].get('isVisible') || !AnsSet[A].get('isEnabled') ){
                            SvT = 0;   
                        } else {
                            if(AnsArr.indexOf(A)>=0){
                                This.DrawShape(ThisC, A, ThisC.Stroke.value, 1)
