                        }
                    })
                }
            },
            "CheckPoint": function(C, shape, coords, posX, posY){
                var CT = C.CT,
                    RatioH = C.RatioH,
                    RatioW = C.RatioW,
                    Return;

                CT.beginPath();
                if(shape == 'rect') {
                    CT.rect(coords[0]*RatioW, coords[1]*RatioH, (coords[2] - coords[0])*RatioW, (coords[3] - coords[1])*RatioH);
                } else if(shape == 'poly') {
                    CT.moveTo(coords[0]*RatioW, coords[1]*RatioH);
                    for(i=2; i < coords.length; i+=2) {
                        CT.lineTo(coords[i]*RatioW, coords[i+1]*RatioH);
                    }
                } else if(shape == 'circle' || shape == 'circ') {
                    CT.arc(coords[0]*RatioW, coords[1]*RatioH, coords[2]*RatioH, 0, Math.PI * 2, false);
                }
                CT.closePath();
                Return = CT.isPointInPath(posX,posY);
                return Return;
