OSM.Survey.valCheck_Time = function(event){
    console.log("F1_time");    

    var check = true;

    var F_time = event.sourceElement.getComment();

    var phut = F_time.split(":")[0];

    var giay = F_time.split(":")[1];

    var mili_giay = F_time.split(":")[2];

    if( phut == undefined || giay == undefined || mili_giay == undefined)
    {

        check = false;

    }else{

        if ( phut.length != 2 || giay.length != 2 || mili_giay.length != 2)
        {
            check = false;
        }

        if (parseInt(phut) > 59)
        {
            check = false;
        }

        if (parseInt(giay) > 59)
        {
            check = false;
        }

        if (parseInt(mili_giay) > 99)
        {
            check = false;
        }

        if (parseInt(phut) == 0 && parseInt(giay) == 0 && parseInt(mili_giay) == 0 )
        {
            check = false;
        }
    }    



    if (check == false)
    {
        return{
            status:false,
            message:"Ghi nhận không đúng format !"
        }
    }    


    return{
        status:true
    }    
};
