OSM.Survey._S12.addEventListener("onEntrance",function(event){

    var arrListCatsOthers = ['_981','_982','_983'];    
    var arrListCats = OSM.Survey.definedCategories(event.sourceElement);  
    arrListCats = OSM.Survey.differenceArrListCatsWith(arrListCats, arrListCatsOthers);

    var pushOthers = new Array();

    for(var item in arrListCatsOthers)
    {
      if(OSM.Survey._S10.isAnswerSelected(arrListCatsOthers[item])) 
      {
        pushOthers.push(arrListCatsOthers[item]); 
      }
    }

    var arrListCatsFinal = OSM.Survey.unionCategories(arrListCats, pushOthers, ['_99']);

    OSM.Survey.initializeQuestion(event.sourceElement, arrListCatsFinal);
});

